import { FC } from "react";
import Todo from "../models/todo";
import TodoItem from "./TodoItem";

const Todos: FC<{ items: Todo[] }> = ({ items }) => {
  return (
    <>
      <ul>
        {items.map((item) => (
          <TodoItem text="" id={items.text} />
        ))}
      </ul>
    </>
  );
};

export default Todos;
